import React from 'react';
import logo from '../image/logo.png';
const Footer = () => {
    return (
        <div className='max-w-7xl mx-auto mt-12 flex'>
            <div className='w-1/4'>
                <img src={logo} className='h-12 w-auto'/>
                <p>SDU Assistant - образовательная платформа для улучшения знания студентов СДУ</p>
            </div>
            <div className='flex flex-col'>
                <h1>О проекте</h1>
                <a>Главная Найти ассистента </a>
                <a>Стать преподавателем </a>
                <a>Публичная оферта</a>
            </div>
            <div className='flex flex-col'>
                <h1>Контакты</h1>
                <a>+7 700 777 77 77</a>
                <a>info@sdu.edu.kz</a>
                <div></div>
            </div>
        </div>
    );
}


export default Footer;
